import React, { useEffect, useState } from "react";
import axios from "axios";

export default function FormSubmit(props) {
  //console.log(props.match.params.FormId);
  useEffect(() => {
    axios
      .get("http://localhost:5000/forms/getform", {
        params: {
          id: props.match.params.FormId,
        },
      })
      .then((res) => {
        console.log(res.data);
      });
    //console.log(forms);

    //console.log(forms);
  }, []);
  return (
    <div>
      <input
        type={res.data.inputType}
        onChange={(val) => setInputVal(val.target.value)}
      ></input>
    </div>
  );
}
